(function($){"use strict";redux.field_objects=redux.field_objects||{};redux.field_objects.js_button=redux.field_objects.js_button||{};redux.field_objects.js_button.mainID="";redux.field_objects.js_button.init=function(selector){if(!selector){selector=$(document).find(".redux-container-js_button")}$(selector).each(function(){var el=$(this);var parent=el;if(!el.hasClass("redux-field-container")){parent=el.parents(".redux-field-container:first")}if(parent.hasClass("redux-field-init")){parent.removeClass("redux-field-init")}else{return}redux.field_objects.js_button.modInit(el);var button=$(el).find("input.redux-js-button");$.each(button,function(key,value){$(value).on("click",function(e){var funcName=$(value).data("function");e.preventDefault();if(funcName!==""){if(typeof window[funcName]==="function"){window[funcName]()}else{throw"JS Button Error.  Function "+funcName+" does not exist."}}})})})};redux.field_objects.js_button.modInit=function(el){redux.field_objects.js_button.mainID=el.attr("data-id");var dev_mode=Boolean(el.find(".redux-js-button-container").data("dev-mode"));if(dev_mode===true){var ver=el.find(".redux-js-button-container").data("version");var dev_html=$("div.redux-timer").html();if(dev_html!==undefined){var pos=dev_html.indexOf("JS Button");if(pos===-1){$("div.redux-timer").html(dev_html+"<br/>JS Button extension v."+ver)}}}}})(jQuery);